import React from "react";
import "./index.css";

function App() {
  return (
    <div className="pad">
      <h1 id="heading">TYPE - WRITER PAD </h1>
      <input
        id="pad_parent"
        size="35"
        className="main"
        autoFocus
        placeholder="Start here"
      />
    </div>
  );
}

export default App;
